

import 'package:flutter/cupertino.dart';
import 'package:flutter/material.dart';

class GridViewExample extends StatelessWidget {
  // Sample data
  final List<Map<String, String>> data = [
    {'title': 'Item 1', 'image': 'data:image/jpeg;base64,'},
    {'title': 'Item 2', 'image': 'data:image/jpeg;base64,'},
    {'title': 'Item 3', 'image': 'data:image/jpeg;base64,'},
    {'title': 'Item 4', 'image': 'data:image/jpeg;base64,'},
    {'title': 'Item 5', 'image': 'data:image/jpeg;base64,'},
    {'title': 'Item 6', 'image': 'data:image/jpeg;base64,'},
  ];

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: Text('GridView Example'),
      ),
      body: Padding(
        padding: const EdgeInsets.all(8.0),
        child: GridView.builder(
          gridDelegate: SliverGridDelegateWithFixedCrossAxisCount(
            crossAxisCount: 2, // Number of columns
            crossAxisSpacing: 10.0, // Space between columns
            mainAxisSpacing: 10.0, // Space between rows
          ),
          itemCount: data.length,
          itemBuilder: (context, index) {
            return GridTile(
              child: Column(
                children: [
                  Expanded(
                    child: Image.network(
                      data[index]['image']!,
                      fit: BoxFit.cover,
                    ),
                  ),
                  SizedBox(height: 8.0),
                  Text(
                    data[index]['title']!,
                    style: TextStyle(fontSize: 16, fontWeight: FontWeight.bold),
                  ),
                ],
              ),
            );
          },
        ),
      ),
    );
  }
}